INSERT INTO `product` VALUES (1,'2022-11-21','Bouquet with light pink and purple roses with white anemone and lavender limonium. Grab your passport, because this arrangement is a direct ticket to romance. It’s easy to fall in love with pretty light pink roses, purple roses, white anemones, lavender caspia, and solomio. These blooms are a fairy tale come true.',1,1,2180915,'Dream Date',95,25,1),(2,'2022-11-21','Coat with quilted lining and an adjustable hood. Featuring long sleeves with adjustable cuff tabs, adjustable asymmetric hem with elastic side tabs and a front zip fastening with placket.',1,1,1916935,'Cardigan',93,17,1),(3,'2022-11-11','Coat with quilted lining and an adjustable hood. Featuring long sleeves with adjustable cuff tabs, adjustable asymmetric hem with elastic side tabs and a front zip fastening with placket.',1,1,1916935,'Santa Tell Me',98,22,1),(4,'2022-10-10','This elegant bouquet pairs white ranunculus with anemones.\r\nBe a real hero with this epic Bouq fit for anyone In the Clouds. Both Zeus and Poppins-approved, these anemones and ranunculus give all the idyllic cumulus cloud vibes. Bring a beautiful day home — no need for an airplane, a magic carpet, or a flying umbrella.',1,1,1916935,'In the Clouds',100,90,1),(5,'2022-03-09','Dry bouquet that pops with purple orchard grass & gypsophila.\r\nBreathe in, and breathe out, because Amethyst is here to relieve any stress. Symbolizing peace, this dried arrangement of violet baby’s breath, dark green eucalyptus, white bunny tails, and orchard grass is a real gem, as radiant and multifaceted as its namesake. Elevate your space and aura with this luxurious Bouq.',1,1,2396750,'Amethyst',91,19,2),(6,'2022-10-10','Classic dried bouquet featuring gold pampas & white loofahs.\r\nWinter, spring, summer, or fall — this dried Bouq takes everyday elegance to a new level. Creating a 5-star medley of texture, Four Seasons blends white loofahs and gold pampas with bleached wild oats and aster, plus green spear palms — unmistakably accented with a stylish fan. Pack whatever you’d like...this one’s fit for an extended vacay.',1,1,1916935,'Four Seasons',99,76,2),(7,'2022-08-04','Coppery dry bouquet with copper pampas & terracotta wheat.\r\nModern minimalism is at its best with this earth-toned beauty. Golden baby’s breath, fluffy copper pampas, pink sorghum, wheat, and dark pink palms bring major Joshua Tree vibes to any vase. Endless spice and texture-rich elegance, anyone? (Yes. The answer is yes.)',1,1,2396750,'Terracotta',100,80,2),(8,'2022-11-11','This bouquet of flowers is composed of white hydrangeas and lilies.\r\nTalk about a natural beauty! Give your vase a real-life glow up with this illuminating mix of white snapdragons, roses, lilies, green mini hydrangeas, and greenery. These farm-fresh beauties are perfect for the person who brightens up your life, whether it\'s a special occasion or just because.',1,1,1799500,'Glowing',100,50,3),(9,'2022-10-10','A bold Limited Edition mixed bouquet of sunflowers, spray roses, and chamomile.\r\nHold up! Baby, you can see this Bouq’s halo wherever you put its vase. Get these bright, beautiful sunflowers, white spray roses, yellow billy balls, and mini hydrangeas in formation for that person in your life who’s irreplaceable.',1,1,1676750,'Queen Bee',100,10,3),(10,'2022-03-09','A cool collection of blue and white hydrangea, roses, agapanthus and Star of Bethlehem — curated for the Elements Collection. \r\nDive into Aquamarine. Blue-lavender globe thistle, agapanthus, and hydrangea float amongst fresh white roses, alstroemeria and Star of Bethlehem for a refreshing arrangement reminiscent of calm waters. Greenery helps ground this water-inspired Bouq. ',1,1,1676750,'Aquamarine',100,100,3),(11,'2022-10-10','Modern winter arrangement featuring blue hydrangeas, white roses, and stars of Bethlehem.\r\nYou know that beautiful moment when the sun reflects off a frozen tree the day after a fresh snowfall? Welcome to Winter Frost. White roses, Stars of Bethlehem, and blue hydrangea meet white disbud mums, green button poms, and pine for a wintery enchantment that’ll take you to a real-life winter wonderland!',1,1,1676750,'Winter Frost',200,310,3),(12,'2022-08-04','Bouquet of pink and ivory roses with carnations, hydrangea and eucalyptus.\r\nWe were wishin’ on shooting stars, and then we found the Bouq of our dreams! Pink and ivory roses, dusty miller, red antique hydrangea, and baby blue eucalyptus are like a sparkly breath of fresh air in dreamland. Pretty pastel blooms set the scene, bringing the loveliest spring vibes into all our favorite vases. It’s so dreamy.',1,1,1799500,'Dreamscape',100,10,3),(13,'2022-07-04','A light, uplifting assortment of white hydrangea, alstroemeria and roses — curated for the Elements Collection. \r\nGet lifted. Clouds of white hydrangea and mini carnations surrounded by gentle alstroemeria and roses lighten the energy and bring inspiration. Blue-green eucalyptus parvifolia completes the air-inspired arrangement. ',1,1,167750,'Cool Breeze',100,30,3),(14,'2022-05-30','DIY Party Box featuring white roses, lilies and hydrangeas.',1,1,4562460,'The Elegance Party Box',40,50,3),(15,'2022-01-29','Enchanting seasonal fall bouquet with orange and red lilies with orange roses and purple scabiosa.\r\nInspired by a refreshing afternoon stroll in your favorite cozy sweater, this seasonal Bouq features bright red hypericum berries, warm orange lilies and roses, and moody scabiosas for fall at its finest. No autumn is complete without one in your basket!',1,1,1916935,'Sweater Weather',80,70,4),(16,'2022-11-21','Elegant bouquet for the holidays with white roses, photinia, and limonium.\r\nSay “baby I love you” to this wintery arrangement. While Bey is not included, this mix of white Asiatic lilies, white roses, and burgundy mini carnations feels like destiny indeed. And the splashes of green eucalyptus and leucadendron? Well, they ain’t runnin’ game this holiday.',1,1,1799500,'Sleigh My Name',100,20,4),(17,'2022-01-21','Stand out from the crowd with this spicy arrangement of Black Charm Red Lilies, Burgundy Snapdragons and Orange Roses.\r\nBreak out your pitcher (or your vase works, too) for fall’s latest harvest, Spiced Sangria. A blend of Black Charm red lilies, burgundy snapdragons, orange roses, and alstroemeria, we’re already ready for another round! Add a dash of fragrant, seeded eucalyptus and voilá: this Spiced Sangria is the perfect addition to your fall tablescape.',1,1,2148460,'Spiced Sangria',100,70,4),(18,'2022-10-02','Orange Asiatic Lily with orange and red roses with peach carnations.\r\nA super-sweet explosion of rich red and orange roses, Asiatic lilies and peach carnations. Deep, bright, and unforgettable—just like all the best love stories. ',1,1,1676750,'Candy Crush',100,20,4),(19,'2022-10-09','Red roses, red carnations, and greenery accents.\r\nSugar and spice are always quite nice, but Sweet Cinnamon is what holiday dreams are made of. This stunning arrangement showcases florals in reds and pinks — including roses, lilies, carnations, and poms — plus gorgeous green accents.  Holiday centerpieces have never looked sweeter!\r\n\r\n',1,1,1799500,'Sweet Cinnamon',100,90,4),(20,'2022-11-07','This vibrant arrangement shines bright with blooming alstroemeria, lilies, and roses.\r\nSo rich and brilliant, you could even say it glows. Red roses, lilies and hypericum bring the best of the season’s signature shade, accented with green pine and poms.',1,1,1676750,'Rudolph',100,20,4),(21,'2022-11-06','This bouquet of flowers is composed of white hydrangeas and lilies.\r\nTalk about a natural beauty! Give your vase a real-life glow up with this illuminating mix of white snapdragons, roses, lilies, green mini hydrangeas, and greenery. These farm-fresh beauties are perfect for the person who brightens up your life, whether it\'s a special occasion or just because. ',1,1,1799500,'Glowing',100,200,4),(22,'2022-07-29','Bouquet featuring pink Oriental Lilies and pink roses with a vase included.\r\nMake an impression with this crush-worthy array of bright pink Oriental lilies, pink roses, and eye-catching red anemones. White Marina vase (and inevitable sparkling conversation) included.  \r\n\r\n',1,1,2269160,'Dream Date',100,20,4),(23,'2022-10-30','Bright arrangement with yellow roses and peach carnations.\r\nIf your neighborhood lemonade stand had a secret menu, this Instaworthy pink and yellow hybrid would cause quite a stir! Here’s the fresh-squeezed recipe: Sit back and pour yourself a tall (glass) vase; fill it with sweet yellow roses, refreshing white lilies, sugary peach carnations, and cool yellow snapdragons. Arrange, adore, and enjoy!\r\n',1,1,1799500,'Lemonade',100,20,4),(24,'2022-09-12','This flower arrangement contains bright pink stargazer lilies.\r\nThese beautiful pink lilies burst onto the scene with all the magic of dusk in bloom form, exploding with color and beauty.',1,1,1916935,'Sierra Sunset',100,100,4),(25,'2022-12-14','This fragrant arrangement showcases sweet-scented pink rose lilies.\r\nWhy, this Bouq is bloomtastic. It’s farm-freshtastic. It’s eye-catchingtastic. Why, it’s Charisma! Pink and white rose lilies combine the beauty of two of our favorites into a single breathtaking bloom, opening to reveal a striking double layer of petals on each stem. It’s kinda the best of the Pink Ladies.',1,1,2036000,'Charisma',100,90,4),(26,'2022-11-16','Orange and pink mix that includes roses and carnations and a lily.\r\nFiery, bold, and colorful, passion makes the world go ‘round. Our Passion Fruit Bouq was designed to kick things up a notch for any occasion! This brilliantly delicious mix of oranges, purples, and pinks includes vibrant alstroemeria, carnations, lilies, roses, and snapdragons — all surrounded by greenery for an exotic vibe. Perfect for passionistas and special someones everywhere.',1,1,1545000,'Passion Fruit',100,20,4),(27,'2022-10-23','Harness the wonder of the season\'s first snowfall with a delivery of this Bouq featuring white lilies and roses.\r\nFresh, pure and exciting, just like that first snow day of the year. Classic white lilies, roses, veronica and hypericum get an exciting new spin with playful blue accents.',1,1,1916935,'First Snow',100,70,4),(28,'2022-09-27','This seasonal favorite features a selection of white blooms, including roses, ranunculus, and alstroemeria.\r\nSend someone this season’s softer side with our prettiest white flowers and berries.',1,1,1799500,'Winter Wonderland',100,10,4),(29,'2022-04-06','A trio of assorted mini orchids.\r\nBig things start with three little wishes. Orchids are known to bring good wishes and luck, and one of our farmers will be personally selecting three eco-friendly, one-of-a-kind mini orchids and sending them your way! Will you place one in every room? Will you keep one for yourself and gift some farm-fresh luck to some other awesome humans? It’s up to you! The more you believe, the luckier you’ll be.\r\nEach orchid comes in its own lightweight, break-proof Ecopot, made from recycled plastic. \r\nOrchid and Ecopot colors will vary.',1,1,1799500,'Three Wishes',100,20,5),(30,'2022-03-30','A beautiful orchid hand selected by our farmers.\r\nWant a gorgeous, one-of-a-kind orchid but can’t decide which color? Let our farmers personally select a seasonal favorite! “Orchidding.” No we’re not! We work directly with our farms to find you the perfect eco-friendly orchid blooming with sustainably grown freshness and good luck! Colors may vary, but the smiles and joy are just the same.',1,1,1799500,'Farmer\'s Choice Orchid',100,90,5),(31,'2022-03-30','10 stems of seasonal peonies.\r\nTurning heads wherever they go, our picture-perfect premium peonies are a must. Our farmers select the freshest blooms for you, and these 10 stems of lush, petal-soft ruffles are some of the prettiest we’ve seen.',1,1,2148460,'Farmer\'s Choice Peonies',100,90,6),(32,'2022-12-09','Warm their heart with this seasonal arrangement of red and white carnations, roses, and purple mini callas.\r\nRed and white roses and carnations flirt with burgundy ranunculus and purple mini calla lilies in this unique and festive arrangement.',1,1,1916935,'Winter Romance',100,80,7),(33,'2022-11-03','This flower arrangement has pink, white and peach ranunculus.\r\nThis elegant mix of bright pink, peach, and white ranunculus satisfies any mood, from playful to polite! This Bouq is a longtime customer favorite, and makes the ideal gift for yourself or someone who deserves a little extra attention. By ideal, we mean absolutely pearlfect.',1,1,1916935,'Pink & Pearl',100,130,7),(34,'2022-10-17','A ranunculus bouquet in a rainbow of varying colors.\r\nNo stand-in could ever pass for these breathtaking blooms with fragrant eucalyptus accents! Vibrant ranunculus are known for their multiple layers of delicate, paper-thin petals. They’re so symmetric and long-lasting we sometimes can’t believe they’re real! But they are. Really!',1,1,1916935,'Standout',100,200,7),(35,'2022-09-11','This elegant bouquet pairs white ranunculus with anemones.\r\nBe a real hero with this epic Bouq fit for anyone In the Clouds. Both Zeus and Poppins-approved, these anemones and ranunculus give all the idyllic cumulus cloud vibes. Bring a beautiful day home — no need for an airplane, a magic carpet, or a flying umbrella.',1,1,1916935,'In the Clouds',100,10,7),(36,'2022-01-18','An arrangement of white lily, snapdragon and ranunculus blooms.\r\nSay, “Here’s lookin’ at you, kid,” with this light and bright Bouq. White lilies, snapdragons, and ranunculus are accented by salal. Casablanca and a vase? It’s the beginning of a beautiful friendship',1,1,1916935,'Casablanca',100,20,7),(37,'2022-10-29','This bouquet is composed of classic red roses.\r\nEternally iconic and elegant, red roses still stand out as the ultimate symbol of unconditional love. If you\'re looking to show someone all the love in your heart (or sweep someone off those feet), this Bouq has a perfect track record. Our advice? Don\'t be afraid to dive in head first. XOXO',1,1,1916935,'Always',100,70,8),(38,'2022-07-24','15 Juliet David Austin roses.\r\nInternationally-renowned David Austin Roses are highly coveted blooms bred for perfection and understated elegance. This iconic Bouq features 15 pink Juliet™ by David Austin Roses.',1,1,2148460,'The Juliet',100,50,8),(39,'2022-05-23','Roses bouquet in fall colors with Phoenix, Country Home, and Merlot roses.\r\nDon’t worry — you can enjoy the sweet, tart joy of Mulberry without staining your fingers. This fresh-for-fall Bouq features light pink alstroemeria and full-sized Merlot, Phoenix and Country Home roses in a stunning palette of sunset reds and oranges. Hebes and Baby Eucalyptus add a cool contrast.',1,1,1799500,'Mulberry',100,90,8),(40,'2022-03-25','This bouquet is made of yellow sunflowers and red lilies.\r\nLooking for something sweet? Bite into our Candy Apple Bouq! It\'s a colorful combination of farm-fresh lilies and sunflowers surrounded with green accent flowers. One of our most versatile fall Bouqs, this pretty mix is meant for all types of occasions and recipients!',1,1,2036000,'Candy Apple',100,90,4),(41,'2022-01-19','This bouquet contains a luxurious blend of pink roses and lilies with white alstroemeria.\r\nLet us take you down, ‘cause we’re going to see a Strawberry Sunset. This beauty is real. Pink roses, lilies and carnations harmonize with white alstroemeria and silver dollar eucalyptus. Strawberry Sunset forever, indeed.\r\n',1,1,1676750,'Strawberry Sunset',100,78,4),(42,'2022-01-15','A bouquet of fresh white Asiatic lilies.\r\nThis stunning mix of white Asiatic lilies is a definite showstopper, and it\'s perfect for everyone in the crowd — especially the one who loves to take center stage. With soft white petals that burst into bloom, admirers will be left wanting an encore stat.',1,1,1676750,'Spotlight',100,120,4),(43,'2022-04-15','Soft-toned bouquet with Coldplay, Early Gray, and White Majolica roses.\r\nKeep it au naturel with this classic Bouq featuring Coldplay and Early Gray roses with delicate white majolica. Très Chic!',1,1,1799500,'French Linen',100,10,8),(44,'2022-08-16','15 assorted pink David Austin Roses. \r\nInternationally-renowned David Austin Roses are highly coveted blooms bred for perfection and understated elegance. This charming Bouq features David Austin’s Darcy, Miranda and Kiera roses in various beautiful pink shades.',1,1,2148460,'The Madeline',100,50,8),(45,'2022-03-11','Stunning peach and pink garden roses paired with our favorite white hammered Marina Vase.\r\nCheers! This high-class cocktail of a Bouq pairs premium peach and pink garden roses with fragrant eucalyptus. So pretty you may want to make it a double. Bonus: crowd-favorite white hammered Marina vase also included.',1,1,2148460,'Cora',100,500,8),(46,'2023-11-19','Bouquet with light pink and purple roses with white anemone and lavender limonium.\r\nGrab your passport, because this arrangement is a direct ticket to romance. It’s easy to fall in love with pretty light pink roses, purple roses, white anemones, lavender caspia, and solomio. These blooms are a fairy tale come true. ',1,1,1916935,'Honeymoon',21,3,1),(50,'2023-11-22','This vase-included arrangement features stunning white roses with a sparkling red vase.\r\nIt doesn’t get any more classically Christmas than this: 24 white roses, red and green berries, and a beautiful snow-speckled red vase. Send to someone who swears they heard reindeer on the roof.',1,1,2269160,'Tinsley',100,0,8),(51,'2023-11-22','Featuring our White Marina Vase, this seasonal Bouq includes white and red roses with hypericum and alstroemeria.\r\nThis exquisite bunch of red and white roses, unique bicolor alstroemeria and red berries in a white Marina vase will make for a truly glorious holiday centerpiece.',1,1,2148460,'Gloria',100,0,8),(52,'2023-11-22','Perfect for spooky season and Halloween, the Black Magic Bouq features an arrangement of black roses.\r\nMysterious, evocative and downright spooky, dyed-black roses are an unexpected and exciting bouquet.',1,1,1916935,'Black Magic',100,0,8),(53,'2023-11-22','This bouquet contains a colorful mix of vibrant roses.\r\nA gorgeous mix of different colored, sustainably grown roses in captivating hues like pink, orange, purple, red, and ivory. This epic rose Bouq is bursting with fun and romance, and it makes a great gift for any and every occasion. Our flowers are grown on eco-friendly, sustainable farms and freshly cut when you order for maximum enjoyment.',1,1,1799500,'Exuberance',100,0,8),(54,'2023-11-22','These roses are a luxurious and white in color.\r\nSend some movie magic with this classic Hollywood starlet. Our white roses are the stars of the show, giving the performance of a lifetime as they bloom, bloom, and bloom some more! Be transported to La-La Land every time you gaze at these beauties.',1,1,1799500,'Hollywoodland',100,0,8),(55,'2023-11-22','15 assorted peach and yellow David Austin Roses. \r\nInternationally-renowned David Austin Roses are highly coveted blooms bred for perfection and understated elegance. This romantic Bouq features David Austin’s Juliet, Edith and Beatrice roses in soft pinks and yellows.',1,1,2148460,'The Diana',100,0,8),(56,'2023-11-22','This fiery fall bouquet features terracotta roses and callas, spray roses, lepidium, and white snapdragons.\r\nThis orange-forward arrangement is sweet as pie. Roses, spray roses and calla lilies accented with white snapdragons evoke not-quite-monochromatic elegance.',1,1,1916935,'Butter Pecan',100,0,8),(57,'2023-11-22','Holiday succulent arrangement with pepperberry, succulent, and white roses balanced by eucalyptus and cedar.\r\nMistletoe? Check. Festive drinks? You know it. Pepperberry? Hello! Meet the Bouq that completes any holiday gathering. White roses and a replantable succulent are enhanced with red alstroemeria, cedar, eucalyptus, and pink pepperberry. Sure these ingredients sound delicious, but our Pepperberry Bouq also LOOKS delightful. With colors this bright, even the Grinch will have to stop and admire its beauty. (Can’t promise he’ll smile though.) ',1,1,2148460,'Pepperberry',100,0,9),(58,'2023-11-22','This bouquet is arranged with assorted succulents.\r\nWith a mix of desert vibes and our favorite lush blooms, we created the bouquet of our wildest dreams! Gorgeous alstroemeria, solidago, and aster are accented with a succulent that brings that much needed vacay right to your vase. Is it basically a trip to Palm Springs in a Bouq? Yes, yes it is.',1,1,1799500,'Wild About U',100,0,9),(59,'2023-11-22','This festive Bouq comes with a beautiful vase and features a succulent, red berries, alstroemeria, genista, and pine.\r\nIt’s Christmas in the desert with this bunch of white alstroemeria, red berries and one striking succulent. Comes with a chic modern ceramic vase.',1,1,1916935,'Holly',100,0,9),(60,'2023-11-22','The Sugar and Spice bundle includes a Deluxe Pepperberry succulent Bouq and French Broad 12-piece Holiday Bon Bon set.\r\nThis festive gift bundle has it all (sugar, spice, everything nice). A Deluxe-sized bunch of white roses, pink pepperberry, red alstroemeria and replantable succulents, plus a box of holiday bonbons from French Broad.',1,1,2875932,'Sugar and Spice',100,0,9),(61,'2023-11-22','What’s Included: A pair of succulents in ecopots and a tray.\r\nLook cute together in photos? Check. Combine air purification skills? Check. Fight crime? TBD. Move over MK & Ashley, we have a new favorite Dynamic Duo. The Haworthia succulent, more commonly known as a zebra plant, is native to South Africa (accent not included) and turns heads with her unique shape and style (hello, little white dots). Her partner-in-crime is a Echeveria Blue Prince, known for his distinct blue-green color and farina-powdered leaves. Keep ‘em close and cuddly on their tray in matching 3\" Ecopots. A low-maintenance pair, they’ll thrive with bright indirect sunlight, water every other week, and all the compliments you want to throw their way.\r\nEcopots are made from recycled plastic and are lightweight and break-proof. These specially designed pots prevent overwatering and allow roots to breathe.',1,1,1290500,'Dynamic Duo',100,0,9),(62,'2023-11-22','This mixed arrangement is blooming with alstroemerias, eucalyptus and succulents.\r\nThe hottest arrangement this side of the Mojave has landed. A mesmerizing blend of alstroemeria, eucalyptus, and showstopping succulents will instantly transport you to the desert southwest. You won’t even need sunscreen!',1,1,1916935,'Never Desert You',100,0,9),(63,'2023-11-22','This floral arrangement contains pink roses & succulents.\r\nThis spray roses and alstroemeria Bouq is putting on a show, but the real star is a beautiful succulent that can be saved and replanted by the lucky recipient!',1,1,2148460,'Showstopper',100,0,9),(64,'2023-11-22','A cheery bouquet filled with yellow sunflowers, poms, and goldenrod.\r\nTurn on some indoor sunshine with this golden Bouq! Fall staples like safari sunset and goldenrod shine as picture-perfect sunflowers steal the show. Embrace the season with some of the prettiest stems from the garden, no messy soil required!',1,1,1796500,'Sunglow',100,0,10),(65,'2023-11-22','Autumn themed flower arrangement featuring Copper Tint and Marley sunflowers, bronze pompons, purple ruscus, and lemon leaves. \r\nA bounty of blooms — the perfect expression of gratitude, celebration, friendship or love. Gather all the best feelings of fall with Harvest, a richly colored arrangement of Marley and Copper Tint sunflowers, bronze pompons, orange and Baby Eucalyptus, deep purple ruscus and lemon leaf.',1,1,2148460,'Autumn Harvest',100,0,10),(66,'2023-11-22','A Deluxe Cali Christmas Bouq bundles with Musee Bath Toy Shop Bath Balm.\r\nWe get it, the holidays can be stressful. Give the gift of relaxation with this beautiful sunflower-forward Bouq bundled with the Toy Shop Village Bath Balm from Musee Bath.',1,1,1916935,'North Pole',100,0,10),(67,'2023-11-22','This flower arrangement contains orange sunflowers, daisies and pincushion proteas.\r\nCool breeze...warm sun...a field of color... It’s basically our favorite fall photo op in a Bouq! Yellow sunflowers are surrounded by orange daisies, pincushions, billy balls, and red roses to create a captivating bouquet that’s bright, bold, and full of seasonal spirit.',1,1,1916935,'Pumpkin Patch',100,0,10),(68,'2023-11-22','A holiday sunflower bouquet mixed with alstroemeria and safari sunset.\r\nGrab a surfboard and some shades, because these blooms are bright and merry as can be! Bold sunflowers, red hypericum berries, and alstroemeria create a Bouq that’s exactly what Santa hopes to receive for a job well done. Cali Christmas is the perfect holiday bunch to honor terrible weather...sled no one ever.',1,1,1799500,'Cali Christmas',100,0,10),(69,'2023-11-22','Radiant fall bouquet including our white Marina vase, sunflower, peach carnations and roses, safari sunset, bronze pompons, and yellow pincushion.\r\nElegant. Timeless. Beloved. Rose Gold features a fresh-for-fall palette of warm gold and deep blush hues, from Veldfire, Safari and peach roses, pink snapdragons, golden sunflower and solidago and warm, peachy pompons, paired perfectly with our white Marina vase. This precious Bouq is sure to be treasured.',1,1,2269160,'Rose Gold',100,0,10),(70,'2023-11-22','This bundle pairs the gorgeous Deluxe Autumn Harvest Bouq with a 2-pack of delectable Compartes chocolate bars. Chocolates are Butter Pecan and Apple Pie flavors.\r\nSend flowers and sweeten the deal for a special fall occasion. A bouquet of rich autumnal sunflowers pairs beautifully with the Apple Pie and Butter Pecan chocolate bars from our friends at Compartés.',1,1,2755095,'Sweet as Pie',100,0,10),(71,'2023-11-22','A vibrant mix of lavender alstroemeria, yellow sunflower, and pink and peach roses.\r\nWant gingham blanket-perfect cheese plate vibes? We’ve got you! The grass is always greener wherever you find this Bouq. Things will be Picnic-perfect with sunflowers, lavender alstroemeria, and peachy-toned roses, spray roses, and hypericum berries. You sure know how to pick ‘em!',1,1,1796500,'Picnic',100,0,10),(72,'2023-11-22','Sunflowers make for the focal flower in this arrangement that also features carnations, marigolds, and alstoemeria.\r\nCome on inside and warm yourself by the glow of this cozy fall arrangement featuring bicolor sunflowers, burgundy carnations, orange alstroemeria and bright marigold.',1,1,2036000,'Fireside Glow',100,0,10),(73,'2023-11-22','This bouquet is blooming with vibrant sunflowers & eucalyptus.\r\nLooking for the perfect gift to give the one with a sunny disposition? Cheery sunflowers are accented with the coolness of silver dollar eucalyptus, plus a pop of purple to top it off. Basically, sending this Bouq would be a really bright idea!',1,1,1916935,'Vibrance',100,0,10),(74,'2023-11-22','This mix is arranged with an assortment of tropical flowers.\r\nGo full-on lush with the blend of vivid colors in this tropical bouquet. Exotic flowers like red ginger are matched with bright greenery to create a little slice of the rainforest you can set anywhere in your home or office. Let the summer lovin\' begin!',1,1,1676750,'Tropical Love',100,0,11),(75,'2023-11-22','A tropical pink ginger flower bouquet.\r\nAnd tell me boy, now wouldn’t that be sweet? What’s even sweeter than that catchy tune: exotic blooms like pink ginger and red cordyline paired with masajeana leaves and more super lush greenery, plus dried okra pods that can be kept for future use. This Bouq is like a little slice of paradise just for you (or one of your favorite people). For us, this one’s love at first sight. Just being honest.',1,1,1676750,'Sweet Escape',100,0,11),(76,'2023-11-22','Tropical bouquet with red ginger, anthurium, hypericum, loofah and aglaonema. \r\nWho are we kidding – we’d rather be in Hawaii for the holidays than shoveling driveways. Enter Tropic Wonderland. This Bouq brings all the tropical vibes with red ginger, red anthurium, and you guessed it, red loofahs. Red-y for more? Santa will be saying surf’s up with the addition of red hypericum berries, aglaonema, and red cordyline. Flowers that feel like an island getaway? They’re at the top of our winter wishlist.',1,1,1799500,'Tropic Wonderland',100,0,11),(77,'2023-11-22','A vibrant assortment of hot pink, orange and red roses, pincushions and exotic palm fronds — curated for the Elements Collection. \r\nLight it up! This bright, eye-catching, fire-inspired Bouq features roses and spray roses in burgundy, fuchsia and orange, with bursts of pink dianthus and orange mini carnations, and pincushion sparks. Green palm fronds frame this show stopping display.',1,1,1799500,'Firecracker',100,0,11),(78,'2023-11-22','Live snake plant housed in a metallic gold pot.\r\nSssspice up your life with our sleek snake plant. Upright green and yellow leaves are known for promoting focus and helping boost your memory. And if you believe all that glitters is gold, then this brushed gold ceramic planter is for you — especially if you’re looking for a good roommate! This plant purifies the air, reduces allergens, and it’s low maintenance. Create an Oasis for your favorite hiss and hers.',1,1,1676750,'Oasis',100,0,11),(79,'2023-11-23','Holiday themed tulips arrangement with white and red parrot tulips.\r\nSo berry nice, this cheerful bunch is sure to entice! Accented by red ilex berries, this red and white parrot tulip Bouq is a fun and festive way to deck the halls of your home for the holidays.',1,1,2148460,'Berry Festive',100,0,12),(80,'2023-11-23','15 assorted David Austin roses.\r\nInternationally-renowned David Austin Roses are highly coveted blooms bred for perfection and understated elegance. This elegant Bouq features peach-pink Charity roses, white Leonora roses and soft apricot Eugenie roses.',1,1,2148460,'The Elizabeth',93,7,12),(81,'2023-11-23','An appropriately sweet arrangement, the Candy Cane Bouq features a mix of red and white carnations, roses, and dianthus.\r\nThis sticky-sweet holiday bunch features bicolor carnations, roses and dianthus, all in red and white just like your favorite peppermint holiday treat.',1,1,1799500,'Candy Cane',100,0,12),(82,'2023-11-23','This wreath includes fresh magnolia, olive and seeded eucalyptus.\r\nThese magnolias may not be steel, but they add just the right amount of charm to one of our new favorite wreaths. Green and tan leaves make for the perfect modern, minimalist decor. Greet the season with this ring of fresh magnolia, olive, and seeded eucalyptus leaves.',1,1,703250,'Magnolia',100,0,14),(83,'2023-11-23','A fresh holiday fir wreath adorned with red berries and pinecones.\r\nIf you’re hot and you\'re coal, you’re yes and you’re Noel, then dress your door in fir and red berries. This wreath will make your space extra cozy and chic with the look and scent of the season. You’ll love it so much, you might make hanging one a yearly tradition—you know, if you haven\'t already.',1,1,1916935,'Noel',100,0,14),(84,'2023-11-23','Mini Christmas tree in red pot with 12 assorted mini red ornaments.\r\nEasily add some Christmas cheer to any coffee table or shelf with this mini tree in a red pot—mini red ornaments included.',1,1,1431635,'Deck The Halls',100,0,14),(85,'2023-11-23','Multicolored tulips and iris bouquet with a love notes book.\r\nFor the Valentine who needs to hear it to believe it. The Love Notes Bundle features our showstopping Heartfelt Bouq paired with a book of real notes written by Bouqs customers, curated by Bouqs founder John Tabis.',1,1,2280910,'Love Notes',98,2,14),(86,'2023-11-23','Vibrant mixed roses with a West Clay Company birthday candle.\r\nWe’re honestly a little jealous of whoever gets this colorful birthday bundle. A deluxe-sized arrangement of multicolored mixed roses pairs perfectly with the OMG, It’s Your Birthday candle from West Clay (scent notes: birthday cake, buttercream frosting and rainbow sprinkles).',1,1,2280910,'Funfetti',99,1,14),(87,'2023-12-03','This flower bouquet is blooming with ivory tulips.\r\nSend our graceful white tulip blooms, fresh from the fields and cut when you order. Plus, this Bouq can be delivered next day from our farms on the California coast straight to your recipient\'s door. Orders must be placed by 2:00 pm EST to arrive next day.',1,1,1440700,'Halo',100,0,13),(88,'2023-12-03','This bouquet is a mix of pink tulips & irises.\r\nWhen we\'re looking for the perfect way to say what we mean, we always seem to reach for this Bouq. This vivid blend of pink and red tulips with purple iris communicates a message that’s sweet, sincere, and says it all.',1,1,2040360,'Heartfelt',97,3,13),(89,'2023-12-03','This bouquet is composed of pink & purple tulips.\r\nKnock knock. Who’s there? Oh, just these pale pink and purple-toned tulips. They offer any vase a one-two punch of beautiful color. It might seem kinda obvious, but this Bouq? It’s a Knockout.',1,1,1918910,'Knockout',96,4,13),(90,'2023-12-03','This bouquet is made up of rainbow colored tulips.\r\nThis all-about-color Bouq takes trending to the next level, and it’s always a favorite! Joyful tulips in shades of red, pink and orange are bursting with happiness. Basically, it’s impossible not to love this bouquet. (Color for days!)',1,1,1796860,'All the Rage',100,0,13),(91,'2023-12-03','Holiday themed tulips arrangement with white and red parrot tulips.\r\nSo berry nice, this cheerful bunch is sure to entice! Accented by red ilex berries, this red and white parrot tulip Bouq is a fun and festive way to deck the halls of your home for the holidays.',1,1,2161810,'Berry Festive',99,1,13),(92,'2023-12-03','Fresh cut red tulips that are as bold and beautiful as you!\r\nYou\'re never too old to believe in the magic of the holidays. This Bouq keeps that magic alive with fresh cut tulips and evergreen accents. Beleaf it or not, these brilliant blooms are fir-ever some of our faves.',1,1,2040360,'Believe',99,1,13);
